eval("module.exports = \"<h2>Syntax</h2>\\n<div class=\\\"m-bottom\\\">bd<span class=\\\"tag\\\">-side</span><span class=\\\"tag\\\">-color</span><span class=\\\"tag\\\">-size</span></div>\\n<h2>Example</h2>\\n<div class=\\\"m-bottom\\\"><span class=\\\"tag\\\">bd-primary</span></div>\\n<h2>Rules</h2>\\n<div class=\\\"m-bottom\\\">\\n  <ul class=\\\"m-top\\\">\\n    <li class=\\\"m-bottom\\\">\\n      <span class=\\\"tag\\\">bd</span> can be used alone, and give a border to its element, with default size and color set in framway's configuration (<span class=\\\"tag\\\">border-default-size</span> & <span class=\\\"tag\\\">border-default-color</span>)\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n        Each modifier can be used or skipped, but should always be in the correct order.\\n        <div class=\\\"d-grid cols-3 cols-md-1 txt-center m-bottom-2\\\">\\n            <div>\\n                <span class=\\\"tag\\\">bd-bottom-primary-5 [correct]</span>\\n                <div class=\\\"bd-bottom-primary-5 m-top\\\">lorem ipsum</div>\\n            </div>\\n            <div>\\n                <span class=\\\"tag\\\">bd-bottom-5 [correct]</span>\\n                <div class=\\\"bd-bottom-5 m-top\\\">lorem ipsum</div>\\n            </div>\\n            <div>\\n                <span class=\\\"tag\\\">bd-5-primary-bottom [wrong]</span>\\n                <div class=\\\"bd-5-primary-bottom m-top\\\">lorem ipsum</div>\\n            </div>\\n        </div>\\n    </li>\\n  </ul>\\n</div>\\n<h2>Notes</h2>\\n<div class=\\\"m-bottom\\\">\\n  <ul class=\\\"m-top\\\">\\n    <li class=\\\"m-bottom\\\">\\n      Bordered elements have a default padding set by the <span class=\\\"tag\\\">spacing</span> config var. To nullify or change this, use the padding classes.\\n    </li>\\n  </ul>\\n</div>\";\n\n//# sourceURL=webpack://framway/./src/components/documentation/templates/manual_borders.html?./node_modules/html-loader/index.js?interpolate");

