eval("module.exports = \"<i class=\\\"center-block w-fit txt-center m-bottom ft-error\\\">\\n  <b>Disclaimer</b><br>\\n   The following makes use of the css grid properties, and thus may or may not fail in old browsers.\\n</i>\\n<h2>Syntax</h2>\\n<div class=\\\"m-bottom \\\">d-grid cols-<span class=\\\"tag\\\">numberColumns</span> rows-<span class=\\\"tag\\\">numberRows</span><span class=\\\"tag\\\">...</span></div>\\n<h2>Example</h2>\\n<div class=\\\"m-bottom \\\"><span class=\\\"tag\\\">d-grid cols-3 rows-3</span></div>\\n<div class=\\\"d-grid cols-3 rows-3 m-bottom\\\">\\n  <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n  <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n  <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n  <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n  <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n  <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n  <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n  <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n  <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n</div>\\n<h2>Rules</h2>\\n<div class=\\\"m-bottom\\\">\\n  <ul class=\\\"m-top\\\">\\n    <li class=\\\"m-bottom\\\">\\n      Grid's columns and rows are defined by the cols- and rows- classes. If none of them are defined, the grid has one column and infinite rows by default.<br>\\n      <i>Example: <span class=\\\"tag\\\">d-grid cols-3</span>, <span class=\\\"tag\\\">d-grid rows-5</span>, <span class=\\\"tag\\\">d-grid cols-3 rows-5</span></i>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      Defining a number of rows will add as much rows as expected, which mean that if you're requesting 3 rows, but fill up only 2, the 3rd will be there, empty.<br>\\n      On another side, if you request 3 rows and fill them up all, any subsequent row will be added with no constraint.<br>\\n      <i>Example: <span class=\\\"tag\\\">d-grid cols-2 rows-3</span></i>\\n      <div class=\\\"d-grid cols-2 rows-3 m-bottom m-top\\\">\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n        <div class=\\\"item_grid ft-i txt-center\\\" style=\\\"background:transparent; border:3px dashed grey;\\\">Empty space</div>\\n        <div class=\\\"item_grid ft-i txt-center\\\" style=\\\"background:transparent; border:3px dashed grey;\\\">Empty space</div>\\n      </div>\\n      <i class=\\\"center-block w-fit\\\">or</i>\\n      <div class=\\\"d-grid cols-2 rows-3 m-bottom m-top\\\">\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"background:grey\\\"></div>\\n        <div class=\\\"item_grid ft-i txt-center\\\" style=\\\"height: 2rem;background:grey;\\\">Subsequent item</div>\\n        <div class=\\\"item_grid ft-i txt-center\\\" style=\\\"height: 2rem;background:grey;\\\">Subsequent item</div>\\n      </div>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      Cols and rows can be defined responsively, by adding classes like this:<br> <span class=\\\"tag\\\">cols|rows</span>-<span class=\\\"tag\\\">breakpoint</span>-<span class=\\\"tag\\\">numberColumns|numberRows</span><br>\\n      <i>Example: <span class=\\\"tag\\\">d-grid cols-3 cols-md-2 cols-sm-1</span> (resize your viewport to see in action)</i>\\n      <div class=\\\"d-grid cols-3 cols-md-2 cols-sm-1 m-bottom m-top\\\">\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n      </div>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      You can tell to grid items to span across cols and/or rows, by adding them classes like this: <br> <span class=\\\"tag\\\">cols|rows</span>-span-<span class=\\\"tag\\\">numberColumns|numberRows</span><br>\\n      Note that rows spanning works better when a number of rows is defined. <br>\\n      <i>Example: <span class=\\\"tag\\\">d-grid cols-3 d-grid cols-3 rows-4</span></i>\\n      <div class=\\\"d-grid cols-3 rows-4 m-bottom m-top\\\">\\n        <div class=\\\"item_grid cols-span-2 txt-center\\\" style=\\\"height:2rem; background:grey\\\">cols-span-2</div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid rows-span-3 txt-center\\\" style=\\\"background:grey\\\">rows-span-3</div>\\n        <div class=\\\"item_grid rows-span-2 cols-span-2 txt-center\\\" style=\\\" background:grey\\\">rows-span-2 cols-span-2</div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n        <div class=\\\"item_grid\\\" style=\\\"height:2rem; background:grey\\\"></div>\\n      </div>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      Grid items order can be changed regarless of their position in the html grid, by adding a class to them: <br>\\n      <span class=\\\"tag\\\">cols</span>-order-<span class=\\\"tag\\\">[0-12]</span><br>\\n      Order can also be changed responsively:<br>\\n      <span class=\\\"tag\\\">cols</span>-order-<span class=\\\"tag\\\">breakpoint</span>-<span class=\\\"tag\\\">[0-12]</span>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      Grid gap value is <span class=\\\"tag\\\">spacing</span> by default, but can be changed by adding a gap class to the container:<br>\\n      gap-<span class=\\\"tag\\\">[0-6]</span><span class=\\\"tag\\\">{-em|rem}</span><br>\\n    </li>\\n  </ul>\\n</div>\";\n\n//# sourceURL=webpack://framway/./src/components/documentation/templates/manual_grid.html?./node_modules/html-loader/index.js?interpolate");

