eval("module.exports = \"<h2>Syntax</h2>\\n<div class=\\\"m-bottom\\\">\\n    img-container r_<span class=\\\"tag\\\">ratioValue</span> <span class=\\\"tag\\\">effectClass</span><br>\\n    <!-- <span class=\\\"tag\\\">zoomin</span> <span class=\\\"tag\\\">zoomout</span> <span class=\\\"tag\\\">fadetocolor</span> <span class=\\\"tag\\\">fadetogrey</span> -->\\n</div>\\n<h2>Example</h2>\\n<div class=\\\"m-bottom\\\">\\n    <pre class=\\\"tag m-bottom\\\">\\n        <div class=\\\"img-container r_16-9 zoomin fadetogrey center w-50\\\"><img src=\\\"https://picsum.photos/500/300\\\" alt=\\\"\\\"></div>\\n    </pre>\\n    <div class=\\\"img-container r_16-9 zoomin fadetogrey center w-50\\\"><img src=\\\"https://picsum.photos/500/300\\\" alt=\\\"\\\"></div>\\n</div>\\n<h2>Rules</h2>\\n<div class=\\\"m-bottom\\\">\\n  <ul class=\\\"m-top\\\">\\n    <li class=\\\"m-bottom\\\">\\n      img elements need to be wrapped in a div with the <span class=\\\"tag\\\">img-container</span> class. This class get by default 100% of the parent's width. You can counter this by adding a <span class=\\\"tag\\\">width</span> utility class.\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n        To apply a specific ratio to the picture, add a ratio class to the <span class=\\\"tag\\\">img-container</span>:\\n        <ul>\\n            <li>r_16-9</li>\\n            <li>r_2-1</li>\\n            <li>r_1-1</li>\\n            <li>r_1-2</li>\\n            <li>r_4-3</li>\\n        </ul>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      By default, pictures in a <span class=\\\"tag\\\">img-container</span> will have an <span class=\\\"tag\\\">object-fit</span> css property set to <span class=\\\"tag\\\">cover</span>. To change this, add a fitting class: <br>\\n      fit--<span class=\\\"tag\\\">contain|scaledown|unset|none</span>      \\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      A picture's natural ratio can differ from its container's, resulting in truncated content. For exemple, if you set a squared picture (ratio 1:1) in an <span class=\\\"tag\\\">img-container</span> with a 16:9 ratio, the top and bottom part of the picture will be cropped to fit the container's width:<br>\\n      <div class=\\\"d-grid cols-2 m-y-x3 center\\\" style=\\\"width: 100%; max-width: 700px;\\\">\\n        <div>\\n          <div class=\\\"img-container r_1-1\\\">\\n            <img class=\\\"\\\" src=\\\"https://picsum.photos/300/300\\\" alt=\\\"\\\">\\n          </div>\\n        </div>\\n        <div class=\\\"alignself--center\\\">\\n          <div class=\\\"img-container r_16-9\\\"><img src=\\\"https://picsum.photos/300/300\\\" alt=\\\"\\\"></div>\\n          <div class=\\\"ft-i txt-center ft-0-8-em\\\">picture doesn't fit the container, so its top and bottom are cropped to stay centered</div>\\n        </div>\\n      </div>\\n      By default, pictures are centered in their container. You can alter the picture positionning by adding a vertical and/or an horizontal position class:\\n      img--<span class=\\\"tag\\\">top|center|bottom</span> img--<span class=\\\"tag\\\">left|center|right</span> <br>\\n      <div class=\\\"d-grid cols-2 m-y-x3 center\\\" style=\\\"width: 100%; max-width: 700px;\\\">\\n        <div>\\n          <div class=\\\"img-container r_1-1\\\">\\n            <img class=\\\"\\\" src=\\\"https://picsum.photos/300/300\\\" alt=\\\"\\\">\\n          </div>\\n        </div>\\n        <div class=\\\"alignself--center\\\">\\n          <div class=\\\"img-container r_16-9 img--bottom\\\"><img src=\\\"https://picsum.photos/300/300\\\" alt=\\\"\\\"></div>\\n          <div class=\\\"ft-i txt-center ft-0-8-em\\\">with img--bottom class</div>\\n        </div>\\n      </div>\\n      <div class=\\\"d-grid cols-2 m-y-x3 center\\\" style=\\\"width: 100%; max-width: 700px;\\\">\\n        <div>\\n          <div class=\\\"img-container r_1-1\\\">\\n            <img class=\\\"\\\" src=\\\"https://picsum.photos/300/300\\\" alt=\\\"\\\">\\n          </div>\\n        </div>\\n        <div class=\\\"alignself--center\\\">\\n          <div class=\\\"img-container r_16-9 img--top\\\"><img src=\\\"https://picsum.photos/300/300\\\" alt=\\\"\\\"></div>\\n          <div class=\\\"ft-i txt-center ft-0-8-em\\\">with img--top class</div>\\n        </div>\\n      </div>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      Pictures can be rounded by adding the <span class=\\\"tag\\\">rounded-circle</span> class to the container. Be aware that this will force a 1:1 ratio on the picture:\\n      <div class=\\\"img-container r_1-1 w-15 r_16-9 m-y-x3 rounded-circle center\\\"><img src=\\\"https://picsum.photos/300/300\\\" alt=\\\"\\\"></div>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      <span class=\\\"tag\\\">grayscale</span> class add a basic grey filter to the picture\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n        You can define basic effects on hover, by adding an effect class to the <span class=\\\"tag\\\">img-container</span>:\\n        <ul>\\n            <li><span class=\\\"tag\\\">zoomin</span><span class=\\\"tag\\\">zoomout</span></li>\\n            <li><span class=\\\"tag\\\">fadetocolor</span><span class=\\\"tag\\\">fadetogrey</span></li>\\n        </ul>\\n    </li>\\n  </ul>\\n</div>\";\n\n//# sourceURL=webpack://framway/./src/components/documentation/templates/manual_images.html?./node_modules/html-loader/index.js?interpolate");

