eval("module.exports = \"<h2>Syntax</h2>\\n<div class=\\\"m-bottom\\\"><span class=\\\"tag\\\">m|p</span>-<span class=\\\"tag\\\">side</span><span class=\\\"tag\\\">-modifier</span> <i class=\\\"fas fa-exclamation-triangle ft-error\\\"></i></div>\\n<h2>Example</h2>\\n<div class=\\\"m-bottom\\\"><span class=\\\"tag\\\">m-top-x2</span></div>\\n<h2>Rules</h2>\\n<div class=\\\"m-bottom\\\">\\n  <ul class=\\\"m-top\\\">\\n    <li class=\\\"m-bottom\\\">\\n      Margins & paddings default value is set in the framway's config, from the <span class=\\\"tag\\\">spacing</span> var.\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      Those utility classes use the <span class=\\\"tag\\\">!important</span> css flag. We assume you know what you're doing.\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      <span class=\\\"tag\\\">m|p</span> is replaced by <span class=\\\"tag\\\">m</span> for margin, or <span class=\\\"tag\\\">p</span> for padding.\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      <span class=\\\"tag\\\">side</span> is replaced by the side's keyword where we want to apply a margin/padding. <br>\\n      Those keywords are: <span class=\\\"tag\\\">top</span>, <span class=\\\"tag\\\">bottom</span>, <span class=\\\"tag\\\">left</span>, <span class=\\\"tag\\\">right</span>. <br>\\n      Aliases can be used to group multiple sides at the same time:\\n      <ul>\\n        <li><span class=\\\"tag\\\">all</span> : means the margin/padding will be applied on all ellement's sides</li>\\n        <li><span class=\\\"tag\\\">x</span> : means the margin/padding will be applied on <span class=\\\"tag\\\">left</span> and <span class=\\\"tag\\\">right</span></li>\\n        <li><span class=\\\"tag\\\">y</span> : means the margin/padding will be applied on <span class=\\\"tag\\\">top</span> and <span class=\\\"tag\\\">bottom</span></li>\\n      </ul>\\n      <i>Examples : <span class=\\\"tag\\\">m-x</span> <span class=\\\"tag\\\">p-all</span></i>\\n    </li>\\n    <li class=\\\"m-bottom\\\">\\n      <span class=\\\"tag\\\">-modifier</span> is an optionnal keyword which changes the margins & paddings values.\\n      <ul>\\n        <li><span class=\\\"tag\\\">-x2</span> will double the default value (<span class=\\\"tag\\\">spacing</span>*2 )</li>\\n        <li><span class=\\\"tag\\\">-x3</span> will triple the default value (<span class=\\\"tag\\\">spacing</span>*3 )</li>\\n        <li><span class=\\\"tag\\\">-x4</span> will quadruple the default value (<span class=\\\"tag\\\">spacing</span>*4 )</li>\\n        <li><span class=\\\"tag\\\">-0</span> will force a margin/padding to 0</li>\\n        <li><span class=\\\"tag\\\">-auto</span> will force a margin/padding to auto (works only for margins)/li>\\n        <li><span class=\\\"tag\\\">-1em</span> will force a margin/padding to 1em</li>\\n      </ul>\\n      <i>Examples : <span class=\\\"tag\\\">m-top-x2</span> <span class=\\\"tag\\\">p-all-0</span></i>\\n    </li>\\n  </ul>\\n</div>\";\n\n//# sourceURL=webpack://framway/./src/components/documentation/templates/manual_margin-padding.html?./node_modules/html-loader/index.js?interpolate");

